const Social = ({ iconclassName, link, text }) => {
  return (
    <li className="mb-3">
      <a href={link} target="_blank">
        <span className="fa-container text-center mr-2">
          <i className={iconclassName}></i>
        </span>
        {text}
      </a>
    </li>
  );
};

export default Social;
